import React from 'react';
import './Card.css'
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/js/bootstrap.js';

class Card extends React.Component {
    render () {
        return (
        <>
            <div className="card border-0 card-description">
                <img src={this.props.data[this.props.nb].media.url} alt={this.props.data[this.props.nb].media.alt} className="item card" />
                <img src={require('../images/logo.svg')} alt="logo" width="250" height="80" class="d-inline-block align-text-top" />
            </div>
            <div class="hide" dangerouslySetInnerHTML={{__html: this.props.data[this.props.nb].description}} /> 
            <p className="flex-name">{this.props.data[this.props.nb].name}</p>
        </>
        );
    }
}
export default Card;
